import React, {Component} from "react";
import './Navbar.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import home from './home.png';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu, Media,
    DropdownItem } from 'reactstrap';
export class Home extends Component {
    constructor(props) {
      super(props);
    }
    render() {
      return (
        <div className="Home">
          <img style={{
            flex: 1,
            alignSelf: 'stretch',
            width: undefined,
            height: undefined
            }}
        src={home} 
        contain
        cover
        resizeMode="stretch"/>
        </div>
      
      );
    }
}

export default Home;
